import React, { Component, useContext } from "react";
import { StyleSheet, TouchableOpacity, Text, Alert } from "react-native";
import { useNavigation } from '@react-navigation/native';
import {AuthContext} from '../AuthProvider';

function MaterialButtonPrimary3(props) {
  const navigation = useNavigation();

  const {register} = useContext(AuthContext);

  return (
    <TouchableOpacity 
      style={[styles.container, props.style]}
      onPress={() => {
        if(props.email === '' || props.password === ''){
          Alert.alert('Ai uitat să introduci toate datele!');
        } else {
          register(props.email, props.password);
        }
        
        }}>
        <Text style={styles.asociație}>Înregistrează-mă</Text>
    </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "rgba(0,149,218,1)",
    justifyContent: "center",
    alignItems: "center",
    flexDirection: "row",
    borderRadius: 2,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 1
    },
    shadowOpacity: 0.35,
    shadowRadius: 5,
    elevation: 2,
    minWidth: 88,
    paddingLeft: 5,
    paddingRight: 5
  },
  asociație: {
    color: "#fff",
    fontSize: 17,
    fontFamily: 'Quicksand'
  }
});

export default MaterialButtonPrimary3;
